feature ccmp {
lookup ccmp_DFLT_1 {
@CombiningTopAccents = [
  acutecomb gravecomb circumflexcomb tildecomb macroncomb brevecomb caroncomb
  dieresiscomb dotaccentcomb ringcomb hungarumlautcomb
  hookabovecomb horncomb
];

@CombiningBelowAccents = [
  dotbelowcomb commaaccentcomb cedillacomb ogonekcomb
  brevebelowcomb ringbelowcomb tildebelowcomb
];

@CombiningAccents = [@CombiningTopAccents @CombiningBelowAccents];

lookupflag UseMarkFilteringSet @CombiningAccents;
sub i' @CombiningAccents by idotless;
sub j' @CombiningAccents by jdotless;
sub iogonek' @CombiningAccents by iogonek.dotless;
sub idotbelow' @CombiningAccents by idotbelow.dotless;
sub superscripti' @CombiningAccents by superscripti.dotless;
} ccmp_DFLT_1;

lookup ccmp_latn_1 {
	lookupflag 0;
	sub fi by f i;
	sub fl by f l;
} ccmp_latn_1;

script latn;
lookup ccmp_latn_1;
lookup ccmp_DFLT_1;

} ccmp;

feature locl {
# automatic
script latn;
language AZE;
lookup locl_latn_0 {
	sub i by idotaccent;
} locl_latn_0;
language CRT;
lookup locl_latn_0;
language KAZ;
lookup locl_latn_0;
language TAT;
lookup locl_latn_0;
language TRK;
lookup locl_latn_0;

script latn;
language ROM;
lookup locl_latn_1 {
	sub Scedilla by Scommaaccent;
	sub scedilla by scommaaccent;
	sub Tcedilla by Tcommaaccent;
	sub tcedilla by tcommaaccent;
} locl_latn_1;
language MOL;
lookup locl_latn_1;

script latn;
language CAT;
lookup locl_latn_2 {
	sub  l' periodcentered' l by ldot;
	sub  L' periodcentered' L by Ldot;
} locl_latn_2;

} locl;

